  {
    id: "q2",
    author: "Bhautik Jani",
    qoute: "Learning React is Awesome!",
  },
  {
    id: "q3",
    author: "Bhautik Ashvinbhai Jani",
    qoute: "Learning React is Great!",
  },
];

